 INSERT INTO tww_sys.dictionary_od_field (class_id, attribute_id, table_name, field_name, field_name_en, field_name_de, field_name_fr, field_name_it, field_name_ro, field_description_en, field_description_de, field_description_fr, field_description_it, field_description_ro, field_mandatory, field_visible, field_datatype, field_unit_en, field_unit_description_en, field_unit_de, field_unit_description_de, field_unit_fr, field_unit_description_fr, field_unit_it, field_unit_description_it, field_unit_ro, field_unit_description_ro, field_max, field_min) VALUES (2,2261,'wastewater_structure','structure_condition','structure_condition','BaulicherZustand','ETAT_CONSTRUCTIF','stato_costruttivo','stare_structura','yyy_Zustandsklassen 0 bis 4 gemäss VSA-Richtline "Erhaltung von Kanalisationen". Beschreibung des baulichen Zustands des Abwasserbauwerks. Nicht zu verwechseln mit den Sanierungsstufen, welche die Prioritäten der Massnahmen bezeichnen (Attribut Sanierungsbedarf).','Zustandsklassen 0 bis 4 gemäss VSA-Richtline "Erhaltung von Kanalisationen (2007)". Beschreibung des baulichen Zustands des Abwasserbauwerks. Nicht zu verwechseln mit den Sanierungsstufen, welche die Prioritäten der Massnahmen bezeichnen (Attribut Sanierungsbedarf).','Classes d''état. Description de l''état constructif selon la directive VSA "Maintien des canalisations" (2007). Ne pas confondre avec les degrés de remise en état (attribut NECESSITE_ASSAINIR)','Classi di stato da 0 a 4 come da direttiva VSA "manutenzione delle canalizzazioni (2007)". Descrizione dello stato costruttivo del manufatto. Da non confondere con le priorità di risanamento, che indicano le priorità degli interventi (attributo necessità_risanamento).','rrr_Descrierea starii structurale Zustandsklassen 0 bis 4 gemäss VSA-Richtline "Erhaltung von Kanalisationen (2007)". Beschreibung des baulichen Zustands des Abwasserbauwerks. Nicht zu verwechseln mit den Sanierungsstufen, welche die Prioritäten der Massnahmen bezeichnen (Attribut San