 INSERT INTO tww_sys.dictionary_od_field (class_id, attribute_id, table_name, field_name, field_name_en, field_name_de, field_name_fr, field_name_it, field_name_ro, field_description_en, field_description_de, field_description_fr, field_description_it, field_description_ro, field_mandatory, field_visible, field_datatype, field_unit_en, field_unit_description_en, field_unit_de, field_unit_description_de, field_unit_fr, field_unit_description_fr, field_unit_it, field_unit_description_it, field_unit_ro, field_unit_description_ro, field_max, field_min) VALUES (2,9303,'wastewater_structure','urgency_figure','urgency_figure','Dringlichkeitszahl','INDICE_D_URGENCE','indice_dell_urgenza','indice_d_urgenta','The urgency figure is the numerical measure for the urgency of rehabilitation measures on a wastewater structure and results from the condition assessment taking into account the condition grade as well as other boundary conditions. The urgency number describes the urgency exclusively from the point of view of the structural and operational condition of a wastewater structure. It is therefore independent of urgencies resulting from other requirements.','Die Dringlichkeitszahl ist das numerische Mass für die Dringlichkeit von Sanierungsmassnahmen an einem Abwasserbauwerk und resultiert aus der Zustandsbewertung unter Berücksichtigung der Zustandsnote sowie weiterer Randbedingungen. Die Dringlichkeitszahl beschreibt die Dringlichkeit ausschliesslich unter Gesichtspunkten, die den baulich-betrieblichen Zustand eines Abwasserbauwerks betreffen. Sie ist daher unabhängig von Dringlichkeiten, die sich aus anderen Erfordernissen ergeben.','L’indice d’urgence est un nombre qui indique l’urgence de mesures de réhabilitation d’un ouvrage du réseau d’assainissement. Il découle de l’appréciation de l’état, basé sur la note d’état ainsi que d’autres facteurs d’influence.','zzz_Il indice dell''urgenza è la misura numerica dell''urgenza delle misure di riabilitazione di una struttura di acque reflue e deriva dalla valutazione delle condizioni, tenendo conto del punteggio delle condizioni e di altre condizioni al contorno. Il numero di urgenza descrive l''urgenza esclusivamente dal punto di vista delle condizioni strutturali e operative di una struttura di acque reflue. È quindi indipendente dalle urgenze derivanti da altri requisiti.','rrr_Indicele de urgen?a este masura numerica a urgen?ei masurilor de reabilitare a unei structuri de ape uzate ?i rezulta din evaluarea starii, luând în considerare scorul de stare ?i alte condi?ii limita. Numarul de urgen?a descrie urgen?a exclusiv din punctul de vedere al starii structurale ?i opera?ionale a unei structuri de apa uzata. Prin urmare, acesta este independent de urgen?ele care rezulta din alte cerin?e.',ARRAY['Werkinformation','GEP_Verband','GEP_Traegerschaft','PAA','SAA']::tww_od.plantype[],'true','smallint',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,400);
