 INSERT INTO tww_sys.dictionary_od_field (class_id, attribute_id, table_name, field_name, field_name_en, field_name_de, field_name_fr, field_name_it, field_name_ro, field_description_en, field_description_de, field_description_fr, field_description_it, field_description_ro, field_mandatory, field_visible, field_datatype, field_unit_en, field_unit_description_en, field_unit_de, field_unit_description_de, field_unit_fr, field_unit_description_fr, field_unit_it, field_unit_description_it, field_unit_ro, field_unit_description_ro, field_max, field_min) VALUES (36,4614,'hydr_geometry','storage_volume','storage_volume','Stauraum','VOLUME_DE_STOCKAGE','volume_stoccaggio','volumul_de_stocare','yyy_Storage content in the basin and in the inlet between the weir crest and the water level at Qan. For stormwater overflow basins in the bypass, the storage capacity at the upstream separating structure or stormwater overflow must be recorded (cf. explanations Contents_catchment section reps. _catchment section). For pumps: Reservoir content in the inlet channel below the water level when the pump is switched on (highest switch-on level for several pumps).','Speicherinhalt im Becken und im Zulauf zwischen Wehrkrone und dem Wasserspiegel bei Qan. Bei Regenbeckenüberlaufbecken im Nebenschluss ist der Stauraum beim vorgelagerten Trennbauwerk bzw. Regenüberlauf zu erfassen (vgl. Erläuterungen Inhalt_Fangteil reps. _Klaerteil). Bei Pumpen: Speicherinhalt im Zulaufkanal unter dem Wasserspiegel beim Einschalten der Pumpe (höchstes Einschaltniveau bei mehreren Pumpen)','Volume de stockage dans un bassin et dans la canalisation d’amenée entre la crête et le niveau d’eau de Qdim (débit conservé). Lors de bassins d’eaux pluviales en connexion latérale, le volume de stockage est à saisir à l’ouvrage de répartition, resp. déversoir d’orage précédant (cf. explications volume utile clarification, resp. volume utile stockage). Pour les pompes, il s’agit du volume de stockage dans la canalisation d’amenée sous le niveau d’eau lorsque la pompe s’enclenche (niveau max d’enclenchement lorsqu’il y a plusieurs pompes). Pour les bassins d’eaux pluviales, à saisir uniquement en connexion directe.','Volume di stoccaggio nel bacino e nella canalizzazione affluente tra soglia di stramazzo e livello d''acqua per la portata conservata. Per bacini di chiarificazione in parallelo deve essere rilevato il volume nel manufatto di ripartizione, rispettivamente nello scaricatore di piena a monte (vedi precisazioni per volume_parte_accumulo rispettivamente volume_parte_decantazione). Per le pompe: volume del pozzo pompe dal fondo fino al livello d''acqua massimo (incl. volume disponibile nella canalizzazione d''entrata).','Con?inutul rezervorului în bazin ?i în intrarea dintre creasta barajului ?i nivelul apei la Qan. În cazul bazinelor de revarsare a apelor pluviale în bypass, trebuie înregistrat spa?iul de stocare la structura de separare din amonte sau la revarsarea apelor pluviale (a se vedea explica?ii Cuprinsul sec?iunii _catchment reps. _catchment section). Pentru pompe: Con?inutul rezervorului în canalul de admisie sub nivelul apei la pornirea pompei (cel mai înalt nivel de pornire pentru mai multe pompe).',ARRAY['GEP_Verband','PAA']::tww_od.plantype[],'true','decimal(9,2)','[m3]','cubic meter [m3]','[m3]','Kubikmeter [m3]','[m3]','mètre cube [m3]','[m3]','metro cubo [m3]','[m3]','rrr_Kubikmeter [m3]',0,10000000);
 INSERT INTO tww_sys.dictionary_od_field (class_id, attribute_id, table_name, field_name, field_name_en, field_name_de, field_name_fr, field_name_it, field_name_ro, field_description_en, field_description_de, field_description_fr, field_description_it, field_description_ro, field_mandatory, field_visible, field_datatype, field_unit_en, field_unit_description_en, field_unit_de, field_unit_description_de, field_unit_fr, field_unit_description_fr, field_unit_it, field_unit_description_it, field_unit_ro, field_unit_description_ro, field_max, field_min) VALUES (36,5875,'hydr_geometry','usable_capacity_storage','usable_capacity_storage','Nutzinhalt_Fangteil','VOLUME_UTILE_STOCKAGE','volume_utile_ritenzione','volumul_util_de_stocare','yyy_Inhalt der Kammer unterhalb der Wehrkrone ohne Stauraum im Zulaufkanal. Letzterer wird unter dem Attribut Stauraum erfasst (bei Anordnung im Hauptschluss auf der Stammkarte des Hauptbauwerkes, bei Anordnung im Nebenschluss auf der Stammkarte des vorgelagerten Trennbauwerkes oder Regenüberlaufs).','Inhalt der Kammer unterhalb der Wehrkrone ohne Stauraum im Zulaufkanal. Letzterer wird unter dem Attribut Stauraum erfasst (bei Anordnung im Hauptschluss auf der Stammkarte des Hauptbauwerkes, bei Anordnung im Nebenschluss auf der Stammkarte des vorgelagerten Trennbauwerkes oder Regenüberlaufs)','Volume de la chambre sous la crête, sans volume de stockage de la canalisation d’amenée. Ce dernier est saisi par l’attribut volume de stockage (lors de disposition en connexion directe ceci se fait dans la fiche technique de l’ouvrage principal, lors de connexion latérale, l’attribution se fait dans la fiche technique de l’ouvrage de répartition ou déversoir d’orage précédant).','NULL','Con?inutul rezervorului în bazin ?i în intrarea dintre creasta barajului ?i nivelul apei la Qan. În cazul bazinelor de revarsare a apelor pluviale în bypass, trebuie înregistrat spa?iul de stocare la structura de separare din amonte sau la revarsarea apelor pluviale (a se vedea explica?ii Cuprinsul sec?iunii _catchment reps. _catchment section). Pentru pompe: Con?inutul rezervorului în canalul de admisie sub nivelul apei la pornirea pompei (cel mai înalt nivel de pornire pentru mai multe pompe).',ARRAY['GEP_Verband','GEP_Traegerschaft','PAA']::tww_od.plantype[],'true','decimal(9,2)','[m3]','cubic meter [m3]','[m3]','Kubikmeter [m3]','[m3]','mètre cube [m3]','[m3]','metro cubo [m3]','[m3]','rrr_Kubikmeter [m3]',0,10000000);
