i ?i nivelul apei la Qan. În cazul bazinelor de revarsare a apelor pluviale în bypass, trebuie înregistrat spa?iul de stocare la structura de separare din amonte sau la revarsarea apelor pluviale (a se vedea explica?ii Cuprinsul sec?iunii _catchment reps. _catchment section). Pentru pompe: Con?inutul rezervorului în canalul de admisie sub nivelul apei la pornirea pompei (cel mai înalt nivel de pornire pentru mai multe pompe).',ARRAY['GEP_Verband','PAA']::tww_od.plantype[],'true','decimal(9,2)','[m3]','cubic meter [m3]','[m3]','Kubikmeter [m3]','[m3]','mètre cube [m3]','[m3]','metro cubo [m3]','[m3]','rrr_Kubikmeter [m3]',0,10000000);
