ornirea pompei (cel mai înalt nivel de pornire pentru mai multe pompe).',ARRAY['GEP_Verband','PAA']::tww_od.plantype[],'true','decimal(9,2)','[m3]','cubic meter [m3]','[m3]','Kubikmeter [m3]','[m3]','mètre cube [m3]','[m3]','metro cubo [m3]','[m3]','rrr_Kubikmeter [m3]',0,10000000);
