guente ordine: nessun_comando, comando_locale, trasmissione_allarme, trasmissione_segnali_misura, comando_composito. Diversamente dall''attributo Telegestione nelle classi VSA-DSS stramazzo e limitatore_portata, questo attributo si riferisce a tutto il comando/messa in allarme del manufatto speciale.','rrr_Steuerung/Alarmierung des Sonderbauwerks. Der Wertebereich ist kumulativ in der folgenden Reihenfolge gedacht: Keine_Steuerung, Lokale_Steuerung, Uebermittlung_Alarm, Uebermittlung_Messsignale, Verbundsteuerung. Im Gegensatz zum Attribut Steuerung in den VSA-DSS-Klassen Ueberlauf und Absperr_Drosselorgan bezieht sich das vorliegende Attribut auf die gesamte Steuerung/Alarmierung des Sonderbauwerks.',ARRAY['GEP_Verband','PAA']::tww_od.plantype[],'true','integer',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
