t entre la différence du débit acheminé à la STEP lors de l''évenement de dimensionnement (Qa) et au début du déversement (Qb) avec Qb. Exemple: Qb = 100 l/s, Qa = 150 l/s -> surcharge = 50%; état actuel optimisé. Etat actuel optimisé: Surcharge optimisée avant réalisation de mesures (Massnahmen). prévu: Surcharge optimisée après réalisation de mesures (Massnahmen)','zzz_Ist: Mehrbelastung der untenliegenden Kanäle beim Dimensionierungsereignis = 100 * (Qab – Qan) / Qan 	[%]. Verhältnis zwischen der abgeleiteten Abwassermengen Richtung ARA beim Anspringen des Entlastungsbauwerkes (Qan) und Qab (Abwassermenge, welche beim Dimensionierungsereignis (z=5) weiter im Kanalnetz Richtung Abwasserreinigungsanlage abgeleitet wird). Beispiel: Qan = 100 l/s, Qab = 150 l/s -> Mehrbelastung = 50%; Ist_optimiert: Optimale Mehrbelastung im Ist-Zustand vor der Umsetzung von allfälligen weiteren Massnahmen; geplant: Optimale Mehrbelastung nach der Umsetzung der Massnahmen.','rrr_Ist: Mehrbelastung der untenliegenden Kanäle beim Dimensionierungsereignis = 100 * (Qab – Qan) / Qan 	[%]. Verhältnis zwischen der abgeleiteten Abwassermengen Richtung ARA beim Anspringen des Entlastungsbauwerkes (Qan) und Qab (Abwassermenge, welche beim Dimensionierungsereignis (z=5) weiter im Kanalnetz Richtung Abwasserreinigungsanlage abgeleitet wird). Beispiel: Qan = 100 l/s, Qab = 150 l/s -> Mehrbelastung = 50%; Ist_optimiert: Optimale Mehrbelastung im Ist-Zustand vor der Umsetzung von allfälligen weiteren Massnahmen; geplant: Optimale Mehrbelastung nach der Umsetzung der Massnahmen.',ARRAY['GEP_Verband','PAA']::tww_od.plantype[],'true','smallint','[%]','percent  [%]','[%]','Prozent [%]','[%]','pourcent [%]','[%]','percento [%]','[%]','rrr_Prozent [%]',0,1000);
