 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (19,5184,9068,'catchment_area','drainage_system_current','drainage_system','drainage_system',NULL,'Drainagesystem',NULL,'systeme_de_drainage',NULL,'sistema_di_drenaggio',NULL,'rrr_Drainagesystem',NULL,'yyy_Drainierte Flächen ausserhalb Siedlungsgebiet, die an die Siedlungsentwässerung angeschlossen sind','Drainierte Flächen ausserhalb Siedlungsgebiet, die an die Siedlungsentwässerung angeschlossen sind','Surfaces drainées à l''extérieur de l''agglomération qui sont raccordées  à l''assainissement urbain.','Superfici drenate fuori dalla zona abitata, allacciate allo smaltimento della zona abitata.','rrr_Drainierte Flächen ausserhalb Siedlungsgebiet, die an die Siedlungsentwässerung angeschlossen sind');
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (19,5184,5186,'catchment_area','drainage_system_current','mixed_system','mixed_system',NULL,'Mischsystem',NULL,'systeme_unitaire',NULL,'sistema_misto',NULL,'rrr_Mischsystem',NULL,'yyy_Schmutzabwasser und Regenabwasser – soweit es nicht versickert oder verdunstet werden kamm – sind an das Mischabwassernetz angeschlossen. Verbindung zu SW/MW-Knoten obligatorisch, Verbindung zu RW-Knoten nicht zulässig.','Schmutzabwasser und Regenabwasser – soweit es nicht versickert oder verdunstet werden kann – sind an das Mischabwassernetz angeschlossen. Verbindung zu SW/MW-Knoten obligatorisch, Verbindung zu RW-Knoten nicht zulässig.','Les eaux usées et les eaux pluviales ne pouvant pas être infiltrées ou évaporées sont raccordées au réseau d’évacuation des eaux unitaire. La liaison avec les nœuds d’EU et d’EM sont obligatoires, celle avec les nœuds EP interdites.','Le acque luride e le acque meteoriche non infiltrabili e che non evaporano devono essere allacciate alla rete delle acque miste. Collegamento obbligatorio ai nodi acque luride/miste, collegamento ad acque meteoriche non ammissibile.',NULL);
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (19,5184,5188,'catchment_area','drainage_system_current','modified_system','modified_system',NULL,'ModifiziertesSystem',NULL,'systeme_modifie',NULL,'sistema_modificato',NULL,'rrr_ModifiziertesSystem',NULL,'yyy_Im Unterschied zum reinen Trennsystem wird beim modifizierten System neben dem Regenabwasser von nicht überdachten havariegefährdeten Flächen ein weiterer Teil des Regenabwassers zur ARA abgeleitet. Verbindung zu SW/MW-Knoten ist obligatorisch. Verbindung zu RW-Knoten zulässig.','Im Unterschied zum reinen Trennsystem wird beim modifizierten System neben dem Regenabwasser von nicht überdachten havariegefährdeten Flächen ein weiterer Teil des Regenabwassers zur ARA abgeleitet. Verbindung zu SW/MW-Knoten ist obligatorisch. Verbindung zu RW-Knoten zulässig.','Contrairement au système séparatif, dans le système modifié, outre les eaux pluviales provenant surfaces non couvertes pouvant être polluées, une autre partie des eaux pluviales (nécessitant généralement un traitement) doit être acheminée vers la STEP. La liaison avec les nœuds EU/EM est obligatoire, celle avec le nœud EP est admise.','Diversamente dal sistema separato, nel sistema modificato oltre alle acque meteoriche di superfici non coperte ed esposte a incidenti deve essere condotta nell''IDA un''altra parte delle acque meteoriche (che in genere necessita di trattamento). Collegamento obbligatorio ai nodi acque luride/miste. Collegamento ammissibile ai nodi acque meteoriche.','rrr_Im Unterschied zum reinen Trennsystem wird beim modifizierten System neben dem Regenabwasser von nicht überdachten havariegefährdeten Flächen ein weiterer Teil des Regenabwassers zur ARA abgeleitet. Verbindung zu SW/MW-Knoten ist obligatorisch. Verbindung zu RW-Knoten zulässig.');
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (19,5184,5185,'catchment_area','drainage_system_current','not_connected','not_connected',NULL,'nicht_angeschlossen',NULL,'non_raccorde',NULL,'non_collegato',NULL,NULL,NULL,'yyy_Teileinzugsgebiet das entwässert wird, aber nicht an eine PAA angeschlossen ist. Z.B. eine Fläche, die über eine SAA direkt in ein Gewässer entwässert wird, oder eine Fläche mit Versickerung über die Schulter. Keine Verbindung mit dem Kanalnetz zulässig.','Teileinzugsgebiet das entwässert wird, aber nicht an eine PAA angeschlossen ist. Z.B. eine Fläche, die über eine SAA direkt in ein Gewässer entwässert wird, oder eine Fläche mit Versickerung über die Schulter. Keine Verbindung mit dem Kanalnetz zulässig.','Un bassin versant assaini mais non raccordé à un OAP, par exemple une surface directement raccordée vers un cours d’eau via un OAS ou une surface avec de l’infiltration par les bas côtés. Aucune liaison possible avec le réseau des canalisations.','Area tributaria da cui l''acqua viene smaltita, ma che anche in futuro non viene collegata ad un impianto IPS. P. es un''area collegata da un ISS ad un ricettore o un''area con infiltrazione sulla banchina. Un collegamento con la rete di canalizzazioni non è ammissibile.',NULL);
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (19,5184,5537,'catchment_area','drainage_system_current','not_drained','not_drained',NULL,'nicht_entwaessert',NULL,'non_evacue',NULL,'non_evacuato',NULL,'rrr_nicht_entwaessert',NULL,'yyy_Entwässerungstechnisch (noch) nicht erschlossene Fläche innerhalb des öffentlichen Kanalisationsbereichs. Z.B. noch nicht überbaute Liegenschaft innerhalb der Bauzone. Keine Verbindung mit dem Kanalnetz zulässig.','Entwässerungstechnisch (noch) nicht erschlossene Fläche innerhalb des öffentlichen Kanalisationsbereichs. Z.B. noch nicht überbaute Liegenschaft innerhalb der Bauzone. Keine Verbindung mit dem Kanalnetz zulässig.','Surface encore non raccordée d’un point de vue de l’assainissement, à l’intérieur du périmètre d’assainissement, par exemple des propriété non construites en zone à bâtir. Aucune liaison possible avec le réseau des canalisations.','Superficie non (ancora) servita come sistema di smaltimento acque all''interno dell''area di canalizzazione pubblica. Ad es. immobile non edificato all''interno della zona edificabile. Un collegamento alla rete di canalizzazione non è ammissibile.',NULL);
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (19,5184,5187,'catchment_area','drainage_system_current','separated_system','separated_system',NULL,'Trennsystem',NULL,'systeme_separatif',NULL,'sistema_separato',NULL,'rrr_Trennsystem',NULL,'yyy_Entwässerungssystem, üblicherweise bestehend aus zwei Leitungs-/Kanalsystemen für die getrennte Ableitung von Schmutz- und Regenabwasser. Schmutzabwasser und Regenabwasser welches gemäss aktueller Gesetzgebung als verschmutzt gilt, sind an das Schmutzabwassernetz angeschlossen, nicht verschmutztes Regenabwasser an das Regenabwassernetz. Verbindung zu SW/MW-Knoten oder RW-Knoten ist obligatorisch. Verbindung zu zweitem Knoten (RW bzw. SW/MW-Knoten) ist zulässig.','Entwässerungssystem, üblicherweise bestehend aus zwei Leitungs-/Kanalsystemen für die getrennte Ableitung von Schmutz- und Regenabwasser. Das Schmutzabwasser sowie das Regenabwasser von nicht überdachten havariegefährdeten Flächen sind an das Schmutzabwassernetz angeschlossen, das übrige Regenabwasser – soweit es nicht versickert oder verdunstet wird – an das Regenabwassernetz. Verbindung zu einem SW/MW-Knoten oder RW-Knoten ist obligatorisch. Verbindung zu zweitem Knoten (RW bzw. SW/MW-Knoten) ist zulässig.','Système d’évacuation des eaux comprenant en principe deux systèmes de réseaux de canalisations pour l’évacuation séparée des eaux usées et des eaux pluviales. Les eaux usées  ainsi que les eaux pluviales provenant de surfaces non couvertes pouvant être polluées sont raccordées au réseau des eaux usées. Le reste des eaux pluviales qui ne peuvent pas être infiltrées ou évaporées sont raccordées au réseau d''eaux pluviales. Les liaisons avec les nœuds d’EU et d’EM ou d''EP sont obligatoires. La liaison avec un deuxième nœud (EP ou EU/EM) est autorisée.','Sistema di smaltimento usuale composto da due reti di canalizzazione per lo smaltimento separato di acque luride e meteoriche. Le acque luride e le acque meteoriche di superfici non coperte esposte a incidenti devono essere collegate alla rete delle acque luride; le restanti acque meteoriche, se non infiltrabili e se non evaporano, vanno collegate alla rete delle acque meteoriche. Il collegamento a un nodo acque luride/acque miste o a un nodo acque meteoriche è obbligatorio. Il collegamento a un secondo nodo (acque meteoriche o acque luride/miste) è ammissibile.','rrr_Entwässerungssystem, üblicherweise bestehend aus zwei Leitungs-/Kanalsystemen für die getrennte Ableitung von Schmutz- und Regenabwasser. Das Schmutzabwasser sowie das Regenabwasser von nicht überdachten havariegefährdeten Flächen sind an das Schmutzabwassernetz angeschlossen, das übrige Regenabwasser – soweit es nicht versickert oder verdunstet wird – an das Regenabwassernetz. Verbindung zu einem SW/MW-Knoten oder RW-Knoten ist obligatorisch. Verbindung zu zweitem Knoten (RW bzw. SW/MW-Knoten) ist zulässig.');
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (19,5184,5189,'catchment_area','drainage_system_current','unknown','unknown',NULL,'unbekannt',NULL,'inconnu',NULL,'sconosciuto',NULL,'necunoscuta',NULL,'yyy_Das Entwässerungssystem ist noch nicht bekannt. Dieser Wert ist nur bei einer noch nicht abgeschlossenen GEP-Bearbeitung zulässig. Keine Regeln bezüglich Verbindung zum Kanalnetz.','Das Entwässerungssystem ist noch nicht bekannt. Dieser Wert ist nur bei einer noch nicht abgeschlossenen GEP-Bearbeitung zulässig. Keine Regeln bezüglich Verbindung zum Kanalnetz.','Cette valeur n’est admise que lors de l''élaboration d’un PGEE. Aucune règle quant aux liaisons avec le réseau des canalisations.','Questo valore è ammesso unicamente durante l''elaborazione PGS. Nessuna regola relativa a collegamenti alla rete di smaltimento.',NULL);
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (19,5184,8693,'catchment_area','drainage_system_current','separated_system_in_preparation','separated_system_in_preparation',NULL,'vorbereitetes_Trennsystem',NULL,'systeme_separatif_prepare',NULL,'predisposizione_sistema_separato',NULL,'rrr_vorbereitetes_Trennsystem',NULL,'yyy_Ist zu vergeben, wenn Teileinzugsgebiete im Trennsystem entwässert sind (siehe Beschreibung zu diesem Wert), die PAA-Regenabwasserleitung, an die das Teileinzugsgebiet angeschlossen ist, aber weiter unten ins Mischabwassernetz mündet.','Ist zu vergeben, wenn Teileinzugsgebiete im Trennsystem entwässert sind (siehe Beschreibung zu diesem Wert), die PAA-Regenabwasserleitung, an die das Teileinzugsgebiet angeschlossen ist, aber weiter unten ins Mischabwassernetz mündet.','Doit être attribuée si le sous-bassin versant est évacué en système séparatif (voir description pour cette valeur) et la conduite d''eaux pluviales OAP auquel le sous-bassin versant est raccordée débouche plus bas dans le réseau d''eaux mixtes.','Da assegnare se le aree tributarie sono drenate nel sistema misto (v. descrizione di questo valore, la condotta acque meteoriche IPS alla quale è allacciata l''area tributaria sfocia più in basso nella rete delle acque miste e la situazione non cambiera nemmeno in futuro.','rrr_Ist zu vergeben, wenn Teileinzugsgebiete im Trennsystem entwässert sind (siehe Beschreibung zu diesem Wert), die PAA-Regenabwasserleitung, an die das Teileinzugsgebiet angeschlossen ist, aber weiter unten ins Mischabwassernetz mündet.');
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (19,5190,9067,'catchment_area','drainage_system_planned','drainage_system','drainage_system',NULL,'Drainagesystem',NULL,'systeme_de_drainage',NULL,'sistema_di_drenaggio',NULL,'rrr_Drainagesystem',NULL,'yyy_Drainierte Flächen ausserhalb Siedlungsgebiet, die an die Siedlungsentwässerung angeschlossen sind','Drainierte Flächen ausserhalb Siedlungsgebiet, die an die Siedlungsentwässerung angeschlossen sind','Surfaces drainées à l''extérieur de l''agglomération qui sont raccordées à l''assainissement urbain.','Superfici drenate fuori dalla zona abitata, allacciate allo smaltimento della zona abitata.','rrr_Drainierte Flächen ausserhalb Siedlungsgebiet, die an die Siedlungsentwässerung angeschlossen sind');
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (19,5190,5191,'catchment_area','drainage_system_planned','mixed_system','mixed_system',NULL,'Mischsystem',NULL,'systeme_unitaire',NULL,'sistema_misto',NULL,'rrr_Mischsystem',NULL,'yyy_Schmutzabwasser und Regenabwasser – soweit sie nicht versickert oder verdunstet werden – sind an das Mischabwassernetz anzuschliessen. Verbindung zu SW/MW-Knoten obligatorisch, Verbindung zu RW-Knoten nicht zulässig.','Schmutzabwasser und Regenabwasser – soweit es nicht versickert oder verdunstet werden kann – sind an das Mischabwassernetz anzuschliessen. Verbindung zu SW/MW-Knoten obligatorisch, Verbindung zu RW-Knoten nicht zulässig.','Les eaux usées et les eaux pluviales ne pouvant pas être infiltrées ou évaporées sont à raccorder au réseau d’évacuation des eaux mixtes. La liaison avec les nœuds EU/EM est obligatoire, la liaison avec le nœud EP n’est pas admise.','Le acque luride e le acque meteoriche non infiltrabili e che non evaporano devono essere allacciate alla rete delle acque miste. Collegamento obbligatorio ai nodi acque luride/miste, collegamento ad acque meteoriche non ammissibile.','rrr_Schmutzabwasser und Regenabwasser – soweit sie nicht versickert oder verdunstet werden – sind an das Mischabwassernetz anzuschliessen. Verbindung zu SW/MW-Knoten obligatorisch, Verbindung zu RW-Knoten nicht zulässig.');
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (19,5190,5193,'catchment_area','drainage_system_planned','modified_system','modified_system',NULL,'ModifiziertesSystem',NULL,'systeme_modifie',NULL,'sistema_modificato',NULL,'rrr_ModifiziertesSystem',NULL,'yyy_Im Unterschied zum reinen Trennsystem ist beim modifizierten System neben dem Regenabwasser von nicht überdachten havariegefährdeten Flächen ein weiterer (i.d.R. behandlungsbedürftiger) Teil des Regenabwassers zur ARA abzuleiten. Verbindung zu SW/MW-Knoten ist obligatorisch. Verbindung zu RW-Knoten zulässig.','Im Unterschied zum reinen Trennsystem ist beim modifizierten System neben dem Regenabwasser von nicht überdachten havariegefährdeten Flächen ein weiterer (i.d.R. behandlungsbedürftiger) Teil des Regenabwassers zur ARA abzuleiten. Verbindung zu SW/MW-Knoten ist obligatorisch. Verbindung zu RW-Knoten zulässig.','Contrairement au système séparatif, dans le système modifié, outre les eaux pluviales provenant de surfaces non couvertes pouvant être polluées, une autre partie des eaux pluviales (nécessitant généralement un traitement) doit être acheminée vers la STEP. La liaison avec les nœuds EP/EM est obligatoire, celle avec le nœud EP est admise.','Diversamente dal sistema separato, nel sistema modificato oltre alle acque meteoriche di superfici non coperte ed esposte a incidenti deve essere condotta nell''IDA un''altra parte delle acque meteoriche (che in genere necessita di trattamento). Collegamento obbligatorio ai nodi acque luride/miste. Collegamento ammissibile ai nodi acque meteoriche.','rrr_Im Unterschied zum reinen Trennsystem ist beim modifizierten System neben dem Regenabwasser von nicht überdachten havariegefährdeten Flächen ein weiterer (i.d.R. behandlungsbedürftiger) Teil des Regenabwassers zur ARA abzuleiten. Verbindung zu SW/MW-Knoten ist obligatorisch. Verbindung zu RW-Knoten zulässig.');
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (19,5190,5194,'catchment_area','drainage_system_planned','not_connected','not_connected',NULL,'nicht_angeschlossen',NULL,'non_raccorde',NULL,'non_collegato',NULL,NULL,NULL,'yyy_Teileinzugsgebiet, das entwässert wird, aber (auch in Zukunft) nicht an eine PAA angeschlossen ist. Z.B. eine Fläche, die über eine SAA direkt in ein Gewässer entwässert wird, oder eine Fläche mit Versickerung über die Schulter. Keine Verbindung mit dem Kanalnetz zulässig.','Teileinzugsgebiet, das entwässert wird, aber (auch in Zukunft) nicht an eine PAA angeschlossen ist. Z.B. eine Fläche, die über eine SAA direkt in ein Gewässer entwässert wird, oder eine Fläche mit Versickerung über die Schulter. Keine Verbindung mit dem Kanalnetz zulässig.','Un bassin versant à assainir mais non raccordé (ultérieurement) à un OAP, par exemple une surface directement raccordée vers un cours d’eau via un OAS ou une surface avec de l’infiltration par les bas côtés. Aucune liaison possible avec le réseau des canalisations.','Area tributaria da cui l''acqua viene smaltita, ma che anche in futuro non viene collegata ad un impianto IPS. P. es un''area collegata da un ISS ad un ricettore o un''area con infiltrazione sulla banchina. Un collegamento con la rete di canalizzazioni non è ammissibile.',NULL);
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (19,5190,5536,'catchment_area','drainage_system_planned','not_drained','not_drained',NULL,'nicht_entwaessert',NULL,'non_evacue',NULL,'non_evacuato',NULL,'rrr_nicht_entwaessert',NULL,'yyy_Fläche innerhalb des öffentlichen Kanalisationsbereichs, die auch in Zukunft nicht erschlossen wird (seltener Fall). Keine Verbindung mit dem Kanalnetz zulässig.','Fläche innerhalb des öffentlichen Kanalisationsbereichs, die auch in Zukunft nicht erschlossen wird (seltener Fall). Keine Verbindung mit dem Kanalnetz zulässig.','Surface encore à l’intérieur du périmètre d’assainissement qui ne sera pas raccordée (cas rare). Aucune liaison possible avec le réseau des canalisations.','Area all''interno della zona servita che anche in futuro non sarà collegatra alla canalizzazione. Un collegamento alla rete di canalizzazione non è ammissibile.',NULL);
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (19,5190,5192,'catchment_area','drainage_system_planned','separated_system','separated_system',NULL,'Trennsystem',NULL,'systeme_separatif',NULL,'sistema_separato',NULL,'rrr_Trennsystem',NULL,'yyy_Entwässerungssystem, üblicherweise bestehend aus zwei Leitungs-/Kanalsystemen für die getrennte Ableitung von Schmutz- und Regenabwasser. Das Schmutzabwasser sowie das Regenabwasser von nicht überdachten havariegefährdeten Flächen sind an das Schmutzabwassernetz anzuschliessen, das übrige Regenabwasser – soweit es nicht versickert oder verdunstet wird – an das Regenabwassernetz. Verbindung zu einem SW/MW-Knoten oder RW-Knoten ist obligatorisch. Verbindung zu zweitem Knoten (RW bzw. SW/MW-Knoten) ist zulässig.','Entwässerungssystem, üblicherweise bestehend aus zwei Leitungs-/Kanalsystemen für die getrennte Ableitung von Schmutz- und Regenabwasser. Das Schmutzabwasser sowie das Regenabwasser von nicht überdachten havariegefährdeten Flächen sind an das Schmutzabwassernetz anzuschliessen, das übrige Regenabwasser – soweit es nicht versickert oder verdunstet wird – an das Regenabwassernetz. Verbindung zu einem SW/MW-Knoten oder RW-Knoten ist obligatorisch. Verbindung zu zweitem Knoten (RW bzw. SW/MW-Knoten) ist zulässig.','Système d’évacuation des eaux comprenant en principe deux systèmes de réseaux de canalisations pour l’évacuation séparée des eaux usées et des eaux pluviales. Les eaux usées  ainsi que les eaux pluviales provenant de surfaces non couvertes pouvant être polluées sont à raccorder au réseau des eaux usées. Le reste des eaux pluviales qui ne peuvent pas être infiltrées ou évaporées sont à raccorder au réseaux des eaux pluviales. Les liaisons avec les nœuds d’EU et d’EM ou d''EP sont obligatoires. La liaison avec un deuxième nœud (EP ou EU/EM) est autorisée.','Sistema di smaltimento usuale composto da due reti di canalizzazione per lo smaltimento separato di acque luride e meteoriche. Le acque luride e le acque meteoriche di superfici non coperte esposte a incidenti devono essere collegate alla rete delle acque luride; le restanti acque meteoriche, se non infiltrabili e se non evaporano, vanno collegate alla rete delle acque meteoriche. Il collegamento a un nodo acque luride/acque miste o a un nodo acque meteoriche è obbligatorio. Il collegamento a un secondo nodo (acque meteoriche o acque luride/miste) è ammissibile.','rrr_Entwässerungssystem, üblicherweise bestehend aus zwei Leitungs-/Kanalsystemen für die getrennte Ableitung von Schmutz- und Regenabwasser. Das Schmutzabwasser sowie das Regenabwasser von nicht überdachten havariegefährdeten Flächen sind an das Schmutzabwassernetz anzuschliessen, das übrige Regenabwasser – soweit es nicht versickert oder verdunstet wird – an das Regenabwassernetz. Verbindung zu einem SW/MW-Knoten oder RW-Knoten ist obligatorisch. Verbindung zu zweitem Knoten (RW bzw. SW/MW-Knoten) ist zulässig.');
