 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (19,5190,8692,'catchment_area','drainage_system_planned','separated_system_in_preparation','separated_system_in_preparation',NULL,'vorbereitetes_Trennsystem',NULL,'systeme_separatif_prepare',NULL,'predisposizione_sistema_separato',NULL,'rrr_vorbereitetes_Trennsystem',NULL,'yyy_Ist zu vergeben, wenn Teileinzugsgebiete im Trennsystem entwässert sind (siehe Beschreibung zu diesem Wert), die PAA-Regenabwasserleitung, an die das Teileinzugsgebiet angeschlossen ist, aber weiter unten ins Mischabwassernetz mündet und dies auch in Zukunft nicht ändern wird.','Ist zu vergeben, wenn Teileinzugsgebiete im Trennsystem entwässert sind (siehe Beschreibung zu diesem Wert), die PAA-Regenabwasserleitung, an die das Teileinzugsgebiet angeschlossen ist, aber weiter unten ins Mischabwassernetz mündet und dies auch in Zukunft nicht ändern wird.','Les sous-bassins versants dont les eaux usées sont évacuées par un réseau d''eaux usées et les eaux pluviales par un réseau d''eaux pluviales doivent, d''après le guide, avoir le SYSTEME_EVACUATION_EAUX_ACTUEL "systeme_separatif". Si les conduites d''eaux pluviales OAP débouchent ensuite sur le système mixte car le système séparatif n''est pas terminé (et ne sera peut-être jamais réalisé), l''attribut systeme_separatif peut être trompeur.','Da assegnare se le aree tributarie sono smaltite nel sistema misto (v. descrizione di questo valore, la condotta acque meteoriche IPS alla quale è allacciata l''area tributaria sfocia più in basso nella rete delle acque miste e la situazione non cambiera nemmeno in futuro.','rrr_Ist zu vergeben, wenn Teileinzugsgebiete im Trennsystem entwässert sind (siehe Beschreibung zu diesem Wert), die PAA-Regenabwasserleitung, an die das Teileinzugsgebiet angeschlossen ist, aber weiter unten ins Mischabwassernetz mündet und dies auch in Zukunft nicht ändern wird.');
