 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (2,181,5370,'wastewater_structure','renovation_necessity','urgent','urgent','UR','dringend','DR','urgente','UR','urgente',NULL,'urgent',NULL,'yyy_Die Massnahmen sind dringend auszuführen. Sofortmassnahmen wie bei kurzfristig sind zu prüfen. Zeithorizont 3-4 Jahre.','Die Massnahmen sind dringend auszuführen. Sofortmassnahmen wie bei kurzfristig sind zu prüfen. Zeithorizont 3-4 Jahre.','Les mesures doivent être réalisées d’urgence. Des mesures immédiates doivent être envisagées comme pour le degré a_court_terme. Délai 3-4 ans','Gli interventi sono urgenti. È da valutare la necessità di eventuali interventi immediati come nel grado 0. Orizzonte 3-4 anni.','La fel ca la termen_scurt dar 3-4 ani');
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (2,181,5368,'wastewater_structure','renovation_necessity','none','none','N','keiner','K','aucune','AN','nessuno',NULL,'niciuna',NULL,'yyy_Es sind keine Massnahmen bis zur nächsten Zustandserfassung und Zustandsbeurteilung erforderlich. Zeithorizont >= 10 Jahre.','Es sind keine Massnahmen bis zur nächsten Zustandserfassung und Zustandsbeurteilung erforderlich. Zeithorizont >= 10 Jahre.','Aucune mesure n’est nécessaire jusqu’au prochain relevé et à la prochaine évaluation de l’état. Délai >= 10 ans','Non sono necessari interventi fino al prossimo rilevamento dello stato e relativa valutazione. Orizzonte >=10 anni','Nu este necesara nici o masura pana la urmatoarea verificare. De la 10 ani in sus.');
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (2,181,2,'wastewater_structure','renovation_necessity','short_term','short_term','ST','kurzfristig','KF','a_court_terme','CT','breve_termine',NULL,'termen_scurt',NULL,'yyy_Die Massnahmen sind sehr dringend und kurzfristig auszuführen. Im Sinne von Sofortmassnahmen können durch provisorische lokale Reparaturen weitere Schäden temporär verhindert werden. Zeithorizont <= 2 Jahre','Die Massnahmen sind sehr dringend und kurzfristig auszuführen. Im Sinne von Sofortmassnahmen können durch provisorische, lokale Reparaturen weitere Schäden temporär verhindert werden. Zeithorizont <= 2 Jahre','Les mesures doivent être réalisées de façon très urgente et à court terme. A titre de mesures immédiates, des réparations locales provisoires permettent de prévenir temporairement d’autres dommages. Délai <= 2 ans','Gli interventi sono molto urgenti e da eseguire entro breve termine. Con interventi immediati di riparazioni locali provvisorie possono essere evitati temporaneamente maggiori danni. Orizzonte <=2 anni','Masuri necesare in termen scurt, maxim 2 ani. Se pot lua masuri provizorii pentru a preveni alte pagube.');
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (2,181,9295,'wastewater_structure','renovation_necessity','long_term','long_term','LT','langfristig','LF','a_long_terme','LT','lungo_termine','LT','termen_lung','TL','These measures can be planned in the long-term. Time horizone 8-10 years','Die Massnahmen können längerfristig geplant werden. Zeithorizont 8-10 Jahre.','Les mesures peuvent être projetées à long terme. Délai 8 - 10 ans','Gli interventi possono essere pianificati a lunga scadenza. Orizzonte 8-10 anni.','8-10 ani');
