 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (2,198,6524,'wastewater_structure','status','abanndoned.suspended_unknown','abanndoned.suspended_unknown','SU','tot.aufgehoben_unbekannt','AU','abandonne.supprime_inconnu','AI','abbandonato.eliminato_sconosciuto',NULL,'abandonata.demolare_necunoscuta',NULL,'yyy_Das Abwasserbauwerk ist aufgehoben, aber es ist nicht bekannt, ob es verfüllt ist oder nicht.','Das Abwasserbauwerk ist aufgehoben, aber es ist nicht bekannt, ob es verfüllt ist oder nicht.','L''ouvrage du réseau d''assainissement est supprimé, mais l''état de la mise en œuvre est inconnu','Il manufatto è stato eliminato, ma non si sa se è stato demolito o no.','rrr_Das Abwasserbauwerk ist aufgehoben, aber es ist nicht bekannt, ob es verfüllt ist oder nicht.');
