 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (2,198,6529,'wastewater_structure','status','other.project','other.project',NULL,'weitere.Projekt','N','autre.projet','PR','altro.progetto',NULL,'alta.proiect',NULL,'yyy_Konkretes Bauprojekt vorhanden oder in Ausführung (im Bau). Bei Absicht Status "geplant" verwenden. Nach Abschluss des Baus Wechsel auf Status "in_Betrieb".','Konkretes Bauprojekt vorhanden oder in Ausführung (im Bau). Bei Absicht Status "geplant" verwenden. Nach Abschluss des Baus Wechsel auf Status "in_Betrieb".','Projet de construction concret existant ou en cours d''exécution (en construction). En cas d''intention, utiliser le statut "planifié". Une fois la construction terminée, passer au statut "en_exploitation".','Esiste un progetto definitivo o il manufatto è in costruzione. Nel caso di intenzione di realizzazione utilizzare lo stato "pianificato". Ad opera realizzata cambiare lo stato in "in_funzione".','Stare care se mentine pana cand proiectul va fi executat.');
