 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (38,4510,4518,'channel','usage_current','creek_water','creek_water',NULL,'Bachwasser',NULL,'eaux_cours_d_eau',NULL,'acqua_corso_acqua',NULL,'ape_curs_de_apa',NULL,'yyy_Wasser eines Fliessgewässers, das gemäss seinem natürlichen Zustand oberflächlich, aber an einigen Orten auch in unterirdischen Leitungen abfliesst.','Wasser eines Fliessgewässers, das gemäss seinem natürlichen Zustand oberflächlich, aber an einigen Orten auch in unterirdischen Leitungen abfliesst.','Eaux d''un cours d''eau s''écoulant dans son état naturel à la surface, mais qui aussi être mis sous terre par endroits','Acqua di un corso d''acqua che scorre in superficie ma che può anche essere intubato a tratti.',NULL);
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (38,4510,4516,'channel','usage_current','discharged_combined_wastewater','discharged_combined_wastewater','DCW','entlastetes_Mischabwasser','EW','eaux_mixtes_deversees','EUD','acque_miste_scaricate',NULL,'ape_mixte_deversate',NULL,'yyy_Wasser aus einem Entlastungsbauwerk, welches zum Vorfluter geführt wird. In diesen Kanal darf kein Schmutzabwasser eingeleitet werden.','Wasser aus einem Entlastungsbauwerk, welches zum Vorfluter geführt wird. In diesen Kanal darf kein Schmutzabwasser eingeleitet werden.','Eau conduite entre un ouvrage de déversement et un exutoire au milieu récepteur. Aucune eau usée ne doit être déversée dans cette canalisation','Acqua scaricata da un manufatto di scarico e immessa in un corso d''acqua. In questa canalizzazione non possono assere immesse acque luride.',NULL);
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (38,4510,4524,'channel','usage_current','industrial_wastewater','industrial_wastewater',NULL,'Industrieabwasser','CW','eaux_industrielles','EUC','acque_industriali',NULL,'ape_industriale',NULL,'yyy_Unter Industrieabwasser werden alle Abwässer verstanden, die bei Produktions- und Verarbeitungsprozessen in der Industrie anfallen.Industrieabwässer müssen i.d.R. vorbehandelt werden, bevor sie in öffentliche Kläranlagen eingeleitet werden können (siehe Indirekteinleiter). Bei direkter Einleitung in Gewässer (siehe Direkteinleiter) ist eine umfangreiche Reinigung in speziellen werkseigenen Kläranlagen erforderlich.','Unter Industrieabwasser werden alle Abwässer verstanden, die bei Produktions- und Verarbeitungsprozessen in der Industrie anfallen. Industrieabwässer müssen i.d.R. vorbehandelt werden, bevor sie in öffentliche Kläranlagen eingeleitet werden können (siehe Indirekteinleiter). Bei direkter Einleitung in Gewässer (siehe Direkteinleiter) ist eine umfangreiche Reinigung in speziellen werkseigenen Kläranlagen erforderlich.','Eaux industrielles ou chimiques: Les eaux industrielles comprennent toutes les eaux produites lors d''un processus de production ou de fabrication. Les eaux industrielles doivent être prétraitées avant d''être déversées dans les canalisations en direction de la STEP communal (voir évacuation indirecte). En cas de déversement direct dans une eaux de surface, un traitement dans une station de traitement spécifique doit être effectué (voir évacuation directe).','Acque industriali o chimiche: comprendono le acque prodotte durante processi industriali o di fabbricazione. Acque industriali devono di regole essere pretrattate, prima di poter essere convogliate in un IDA. Nel caso di un''immissione diretta nel ricettore è necessario un trattamento in speciali impianti industriali.',NULL);
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (38,4510,4522,'channel','usage_current','combined_wastewater','combined_wastewater',NULL,'Mischabwasser','MW','eaux_mixtes','EUM','acque_miste',NULL,'ape_mixte',NULL,'yyy_1. Mischung von Schmutz- und Regenabwasser, die gemeinsam abgeleitet werden 2. Abwasser welches aus einer Mischung von Schmutzabwasser und Regenabwasser besteht','1. Mischung von Schmutz- und Regenabwasser, die gemeinsam abgeleitet werden 2. Abwasser welches aus einer Mischung von Schmutzabwasser und Regenabwasser besteht','1. Réunion des eaux usées et eaux pluviales dans la même canalisation','Miscela di acque luride e pluviali.',NULL);
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (38,4510,9023,'channel','usage_current','surface_water','surface_water',NULL,'Niederschlagsabwasser',NULL,'eaux_de_surface',NULL,'acque_piovane',NULL,'apa_meteorica',NULL,'Water from precipitation, which has not seeped into the ground and is discharged to the drain or sewer system directly from the ground orfrom exterior building surfaces (DIN EN 16323). The allocation to polluted or unpolluted wastewater is made according to the water protection legislation or according to the instructions of the VSA guideline "Wastewater disposal during rainfall".','Unter Niederschlagswasser versteht man das Wasser, welches bei einem Niederschlagsereignis auf eine Oberfläche fällt. Solange es nicht abfliesst und direkt versickert, gilt es als Niederschlagswasser. Sobald es nicht direkt versickert, sondern zuerst über eine bebaute oder befestigte Fläche abfliesst, gilt es als Niederschlagsabwasser.','Eaux de précipitation non infiltrées dans le sol et rejetées depuis le sol ou les surfaces extérieures des bâtiments dans les réseaux d’évacuation et d’assainissement (SIA 190.301 = EN 16323:2014). Classification en eaux polluées et non polluées selon la législation sur la protection des eaux resp. selon la directive VSA "Gestion des eaux urbaines par temps de pluie".','Precipitazione che non è infiltrata nel suolo, e che defluisce da superfici o edificazioni nella rete di smaltimento (DIN EN 16323). L''attribuzione ad acque di scarico inquinate o non inquinateavviene secondo la legge sulal protezione delel acque, rispettivamente sulla abse dell''ausilio alla direttiva VSA  "smaltimento acque meteoriche"','rrr_Niederschlag, der nicht im Boden versickert ist und von Bodenoberflächen oder von Gebäudeaussenflächen in das Entwässerungsystem eingeleitet ist (DIN EN 16323). Die Zuordnung zu verschmutztem oder unverschmutztem Abwasser erfolgt nach der Gewässerschutzgesetzgebung bzw. nach Anleitung der VSA-Richtlinie "Abwasserentsorgung bei Regenwetter".');
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (38,4510,4514,'channel','usage_current','clean_wastewater','clean_wastewater',NULL,'Reinabwasser','KW','eaux_claires','EUR','acque_chiare',NULL,'ape_conventional_curate',NULL,'yyy_Sicker-, Grund-, Quell- und Brunnenwasser sowie Kühlwasser aus Durchlaufkühlungen. Gemäss Gewässerschutzgesetz gilt Reinabwasser als unverschmutztes Abwasser (SN 592''000).','Sicker-, Grund-, Quell- und Brunnenwasser sowie Kühlwasser aus Durchlaufkühlungen. Gemäss Gewässerschutzgesetz gilt Reinabwasser als unverschmutztes Abwasser (SN 592 000).','Terme générique pour l''eau de drainage, de source, souterraine, des fontaines, ainsi que de l''eau de refroidissement. Les eaux claires sont considérées comme non polluées (SN 592 000).','Termine generico per acque di drenaggio, sorgive, di falda, di fontane e acque di raffreddamento. Secondo la LPAc le acque chiare sono considerate come non inquinate  (SN 592 000).',NULL);
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (38,4510,4526,'channel','usage_current','wastewater','wastewater',NULL,'Schmutzabwasser','SW','eaux_usees','EU','acque_luride',NULL,'ape_uzate',NULL,'yyy_Durch Gebrauch verändertes Wasser (häusliches, gewerbliches oder industrielles Abwasser), das in eine Entwässerungsanlage eingeleitet und einer Abwasserbehandlung zugeführt werden muss. Schmutzabwasser gilt als verschmutztes Abwasser im Sinne des Gewässerschutzgesetzes (SN 592 000)','Durch Gebrauch verändertes Wasser (häusliches, gewerbliches oder industrielles Abwasser), das in eine Entwässerungsanlage eingeleitet und einer Abwasserbehandlung zugeführt werden muss. Schmutzabwasser gilt als verschmutztes Abwasser im Sinne des Gewässerschutzgesetzes (SN 592 000)','Eaux transformées par leur utilisation (domestique, artisanale ou industrielle) et qui sont rejetées dans un système d''évacuation et qui doivent être conduites à un traitement','Acqua trasformata dal loro utilizzo (domenstico, commerciale o industriale), che sono immesse in impianto di raccoltae devono essere trasportate ad un''IDA. Acque luride sono considerate acque inquinate nel senso della LPAc (SN 592 000)',NULL);
