 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (49,3232,3351,'pipe_profile','profile_type','egg','egg','E','Eiprofil','E','ovoide','OV','ovoidale',NULL,'ovoid',NULL,'yyy_Nur für Norm-Eiprofile gemäss DIN 4263 mit Höhenbreitenverhältnis von 1.5 verwenden. Andere Eiprofile, auch solche mit Einbauten, sind als „Spezialprofil“ zu attributieren und die Profildefinition ist mitzuliefern.','Nur für Norm-Eiprofile gemäss DIN 4263 mit Höhenbreitenverhältnis von 1.5 verwenden. Andere Eiprofile, auch solche mit Einbauten, sind als „Spezialprofil“ zu attributieren und die Profildefinition ist mitzuliefern.','A utiliser uniquement pour les profils ovoïdes normés selon DIN 4263 ayant un rapport hauteur/largeur de 1.5. Pour les autres profils ovoïdes, même ceux avec des modifications, la valeur devient « profil_special » et une définition du profil est à joindre.','Solo per profili ovoidali secondo la norma DIN 4263 con rapporto altezza/larghezza di 1.5. Altri profili ovoidali, anche quelli con installazioni, devono essere considerati come “profilo speciale” e forniti con la definizione del profilo.',NULL);
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (49,3232,3350,'pipe_profile','profile_type','circle','circle','CI','Kreisprofil','K','circulaire','CI','cicolare','CI','rotund','R','Use only for circle profiles without dry weather fume or other modifications of the rectangular shape. Else use "special_profile" and send the profile geometry along with the dataset.','Nur für reine Kreisprofile ohne Trockenwetterrinne oder andere Einbauten verwenden. Sonst als „Spezialprofil“ attributieren und die Profildefinition mitliefern.','A utiliser uniquement pour des profils circulaires normés, sans cunette de débit par temps sec ou autres modifications. Sinon la valeur devient « profil_special » et une définition du profil est à joindre.','Solo per profili circolari classici senza canaletta per tempo secco o altre installazioni. Altrimenti devono essere considerati come “profilo speciale” e forniti con la definizione del profilo.',NULL);
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (49,3232,3352,'pipe_profile','profile_type','mouth','mouth','M','Maulprofil','M','profil_en_voute','V','composto','C','sectiune_cu_bolta',NULL,'Use only for mouth profiles as defined in DIN 4263 (German Engineering Norm). If you have modifications to this use "special_profile" instead and send along the profile geometry with the dataset.','Nur für Norm-Maulprofile gemäss DIN 4263 verwenden. Abweichende Varianten, auch solche mit Einbauten, sind als „Spezialprofil“ zu attributieren und die Profildefinition ist mitzuliefern.','A utiliser uniquement pour les profils en voûte normés selon DIN 4263. Pour les variantes, même avec modifications, la valeur devient « profil_special » et une définition du profil est à joindre.','Solo per profili composti secondo la norma DIN 4263. Altri profili composti, anche quelli con installazioni, devono essere considerati come “profilo speciale” e forniti con la definizione del profilo.',NULL);
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (49,3232,3354,'pipe_profile','profile_type','open','open','OP','offenes_Profil','OP','profil_ouvert','PO','sezione_aperta','SA','profil_deschis',NULL,'Use only for rectangular profiles without dry weather fume or other modifications of the For open profiles. Send the profile geometry along with the data set.','Für offene Profile. Profildefinition mitliefern','A utiliser uniquement pour les profils ouverts. Une définition du profil est à joindre.','Per profili aperti. Fornire con la definizione del profilo.',NULL);
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (49,3232,3353,'pipe_profile','profile_type','rectangular','rectangular','R','Rechteckprofil','R','rectangulaire','R','rettangolare','R','dreptunghiular','D','Use only for rectangular profiles without dry weather fume or other modifications of the rectangular shape. Else use "special_profile" and send the profile geometry along with the dataset.','Nur für reine Rechteckprofile ohne Trockenwetterrinne oder andere Einbauten verwenden. Sonst als „Spezialprofil“ attributieren und die Profildefinition mitliefern.','A utiliser uniquement pour des profils rectangulaires normés, sans cunette de débit par temps sec ou autres modifications. Sinon la valeur devient « profil_special » et une définition du profil est à joindre.','Solo per profili rettangolari senza canaletta per tempo secco o altre installazioni. Altrimenti devono essere considerati come “profilo speciale” e forniti con la definizione del profilo.',NULL);
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (49,3232,3355,'pipe_profile','profile_type','special','special','S','Spezialprofil','S','profil_special','PS','sezione_speciale','S','sectiune_speciala','S','For closed not normed profiles. The profile geometry always has to go along with this profile also.','Für geschlossene nicht-Normprofile. Profildefinition mitliefern.','Pour des profils fermés non conformes. Une définition du profil est à joindre.','Per profili chiusi non a norma. Fornire con la definizione del profilo.',NULL);
