 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (5100,8526,8528,'log_card','control_remote_control','local_control','local_control',NULL,'lokale_Steuerung',NULL,'commande_locale',NULL,'comando_locale',NULL,'rrr_lokale_Steuerung',NULL,'No remote transmission/alarming','Keine Fernübertragung/Alarmierung','Pas de transmission à distance/d''alarme','Nessuna trasmissione/allarme a distanza','Fara transmisie/alarmare de la distan?a');
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (5100,8526,8529,'log_card','control_remote_control','transmission_alarm','transmission_alarm',NULL,'Uebermittlung_Alarm',NULL,'transmission_alarme',NULL,'trasmissione_allarme',NULL,'rrr_Uebermittlung_Alarm',NULL,'Requires local control. Alarms are transmitted but no other signals','Setzt lokale Steuerung voraus. Alarme werden übertragen aber keine weiteren Signale.','Nécessite une commande locale. Les alarmes sont transmises mais aucun autre signal.','Richiede un controllo locale. Gli allarmi vengono trasmessi ma nessun altro segnale.','Necesita control local. Alarmele sunt transmise, dar nu ?i alte semnale');
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (5100,8526,8530,'log_card','control_remote_control','transmission_measuring_signals','transmission_measuring_signals',NULL,'Uebermittlung_Messsignale',NULL,'transmission_signaux_mesure',NULL,'trasmissione_segnali_misura',NULL,'rrr_Uebermittlung_Messsignale',NULL,'Requires local control. In addition to alarms, other measurement data is also transmitted, usually to a process control system (PCS).','Setzt lokale Steuerung voraus. Neben Alarmen werden auch weitere Messdaten übertragen, i.d.R. auf ein Prozessleitsystem (PLS).','Présuppose une commande locale. Outre les alarmes, d''autres données de mesure sont transmises, généralement à un système de contrôle de processus (SCP).','Richiede un controllo locale. Oltre agli allarmi, vengono trasmessi anche altri dati di misurazione, di solito a un sistema di controllo di processo (SCP)','Necesita control local. În plus fa?a de alarme, sunt transmise ?i alte date de masurare, de obicei catre un sistem de control al procesului (SCP).');
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (5100,8526,8533,'log_card','control_remote_control','unknown','unknown',NULL,'unbekannt',NULL,'inconnu',NULL,'sconosciuto',NULL,'necunoscuta',NULL,NULL,NULL,NULL,NULL,NULL);
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (5100,8526,8531,'log_card','control_remote_control','interconnection_control','interconnection_control',NULL,'Verbundsteuerung',NULL,'commande_combinee',NULL,'comando_composito',NULL,'rrr_Verbundsteuerung',NULL,'Requires local control. In addition to alarms, other measurement data is also transmitted to a process control system (PCS). The PCS can also send control or status signals back to the structure for interconnected control.','Setzt lokale Steuerung voraus. Neben Alarmen werden auch weitere Messdaten auf ein Prozessleitsystem (PLS) übertragen. Das PLS kann ausserdem auch Steuerungs- oder Statussignale an das Bauwerk zurücksenden zwecks Verbundsteuerung.','Présuppose une commande locale. Outre les alarmes, d''autres données de mesure sont transmises à un un système de contrôle de processus (SCP). Le SCP peut en outre renvoyer des signaux de commande ou d''état à l''ouvrage en vue d''une commande interconnectée.','Richiede un controllo locale. Oltre agli allarmi, altri dati di misurazione vengono trasmessi a un sistema di controllo di processo (SCP). Il SCP può anche inviare segnali di controllo o di stato all''edificio per il controllo interconnesso.','Necesita control local. În plus fa?a de alarme, alte date de masurare sunt, de asemenea, transmise catre un sistem de control al procesului (SCP). SCP poate trimite, de asemenea, semnale de control sau de stare catre cladire în scopul controlului interconectat.');
