 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (5106,5943,5945,'bio_ecol_assessment','intervention_demand','yes_short_term','yes_short_term',NULL,'ja_kurzfristig',NULL,'oui_a_court_terme',NULL,'si_corto_termine',NULL,'rrr_ja_kurzfristig',NULL,'Great influence of the discharge point due to investigation, therefore need for action in the short term.','Grosser Einfluss der Einleitstelle aufgrund Untersuchung, daher kurzfristiger Handlungsbedarf.','Forte influence du rejet sur la base de l''analyse, donc besoin d''intervention à court terme.','Grande influenza del punto di scarico a causa delle indagini, quindi necessità di interventi a breve termine.','Influen?a mare a punctului de deversare din cauza investiga?iei, prin urmare este nevoie de masuri pe termen scurt.');
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (5106,5943,6272,'bio_ecol_assessment','intervention_demand','yes_long_term','yes_long_term',NULL,'ja_laengerfristig',NULL,'oui_a_long_terme',NULL,'si_lungo_termine',NULL,'rrr_ja_laengerfristig',NULL,'Medium impact of discharge point based on investigation, therefore longer term action required.','Mittlerer Einfluss der Einleitstelle aufgrund der Untersuchung, daher längerfristiger Handlungsbedarf.','Influence moyenne du rejet sur la base de l''analyse, donc besoin d''intervention à long terme.','Impatto medio del punto di scarico in base all''indagine, quindi necessità di intervento a lungo termine.','Impactul mediu al punctului de deversare pe baza investiga?iei, prin urmare este nevoie de masuri pe termen lung.');
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (5106,5943,8695,'bio_ecol_assessment','intervention_demand','no_conclusion_possible','no_conclusion_possible',NULL,'keine_Aussage_moeglich',NULL,'aucun_avis_possible',NULL,'giudizio_non_possibile',NULL,'nicio_declaratie_posibila',NULL,'Due to the circumstances, the investigation does not allow any statement on the influence of the discharge point on the water body. A further water investigation could not provide any additional findings.','Die Untersuchung lässt aufgrund der Gegebenheiten keine Aussage zum Einfluss der Einleitstelle auf das Gewässer zu. Eine weitere Gewäasseruntersuchung könnte keine zusätzlichen Erkenntnisse liefern.','En raison des conditions, l''analyse ne permet pas de se prononcer sur l''influence du rejet. Une autre analyse ne permettrait pas fournir de connaissances supplémentaires.','A causa delle circostanze, l''indagine non consente di fare dichiarazioni sull''influenza del punto di scarico sul corpo idrico. Un''ulteriore indagine sulle acque non ha potuto fornire ulteriori risultati.','Din cauza circumstan?elor, ancheta nu permite nicio declara?ie privind influen?a punctului de deversare asupra corpului de apa. O investiga?ie suplimentara a apei nu a putut furniza constatari suplimentare.');
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (5106,5943,5944,'bio_ecol_assessment','intervention_demand','no','no',NULL,'nein',NULL,'non',NULL,'no',NULL,'nu',NULL,'No influence of the discharge point based on the investigation, therefore no action required.','Kein Einfluss der Einleitstelle aufgrund der Untersuchung, daher kein Handlungsbedarf.','Pas d''influence du rejet sur la base de l''analyse, donc pas de besoin d''intervention.','L''indagine non ha evidenziato alcuna influenza sul punto di scarico, pertanto non è necessario intervenire.','Nu exista nicio influen?a a punctului de deversare pe baza investiga?iei, prin urmare nu este necesara nicio ac?iune.');
 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (5106,5943,9093,'bio_ecol_assessment','intervention_demand','clarify_status','clarify_status',NULL,'Status_klaeren',NULL,'clarifier_statut',NULL,'chiarire_stato',NULL,'rrr_Status_klaeren',NULL,'The investigation yielded unclear results. Further findings are expected from a renewed / more extensive water investigation.','Die Untersuchung ergab unklare Ergebnisse. Von einer erneuten / weitergehenden Gewässeruntersuchung sind weitere Erkenntnisse zu erwarten.','L''analyse a donné des résultats peu clairs. Des informations supplémentaires sont attendues d''une analyse nouvelle / plus approfondie.','I risultati dell''indagine non erano chiari. Si attendono ulteriori risultati da una nuova e più estesa indagine sui corsi d''acqua.','Rezultatele anchetei au fost neclare. Sunt a?teptate alte constatari în urma unei investiga?ii reînnoite / mai ample a cursului de apa.');
