 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (5106,5880,9149,'bio_ecol_assessment','type_water_body','lake','lake',NULL,'See',NULL,'lac',NULL,'lago',NULL,'rrr_See',NULL,'With Module G of the VSA Guideline Wastewater Management in Stormwater (2021), the distinction between small and large lakes will be abolished. This is not relevant for the water ecological assessment and is also not clearly defined.','Mit dem Modul G der VSA-Richtlinie Abwasserbewirtschaftung bei Regenwetter (2021), wird die Unterscheidung von kleinen und grossen Seen aufgehoben. Diese ist für die gewässerökologische Beurteilung nicht relevant und auch nicht klar definiert.','Le module G de la directive VSA sur la gestion des eaux usées par temps de pluie (2021) supprime la distinction entre petits et grands lacs. Elle n''est pas pertinente pour l''évaluation écologique des masses d''eau et n''est pas clairement définie.','Il modulo G della linea guida VSA sulla gestione delle acque reflue in tempo di pioggia (2021) abolisce la distinzione tra laghi piccoli e grandi. Questo non è rilevante per la valutazione ecologica dei corpi idrici e non è chiaramente definito.','rrr_Mit dem Modul G der VSA-Richtlinie Abwasserbewirtschaftung bei Regenwetter (2021), wird die Unterscheidung von kleinen und grossen Seen aufgehoben. Diese ist für die gewässerökologische Beurteilung nicht relevant und auch nicht klar definiert.');
