installations de traitement.','Impianto per il trattamento delle acque di scarico stradali (SABA) o delle acque meteoriche da zone edificate come filtri in terreno vegetale, filtri split, filtri a sabbia o filtri tecnici e adsorber artificiali. Realizzazioni di trincee superficiali, pozzetto d''ispezione, di manufatti speciali/bacino o impianto tecnico. Bacini di decantazione (=raccoglitori di fanghi o bacini di chiarificazione) non sono qui considerati impianti di trattamento; per questi sono previsti attributi specifici.','rrr_Anlage zur weitergehenden Behandlung von Strassenabwasser (SABA) oder Regenabwasser aus dem Liegenschaftsbereich wie Boden-, Splitt-, Sand- oder technische Filter und künstliche Adsorber. Bauliche Ausprägung als Mulde, (Norm-)Schacht, Spezialbauwerk/Becken oder technische Anlage. Reine Absetzschächte und -becken (=Schlammsammler bzw. Regenklaerbecken) gelten in diesem Sinn nicht als Behandlungsanlagen, für sie sind separate Attribut-Werte vorhanden.');
