 INSERT INTO tww_sys.dictionary_od_values (class_id, attribute_id, value_id, table_name, field_name, value_name, value_name_en, shortcut_en, value_name_de, shortcut_de, value_name_fr, shortcut_fr, value_name_it, shortcut_it, value_name_ro, shortcut_ro, value_description_en, value_description_de, value_description_fr, value_description_it, value_description_ro) VALUES (57,101,4799,'special_structure','function','separating_structure','separating_structure',NULL,'Trennbauwerk','TS','ouvrage_de_repartition','OR','camera_ripartizione',NULL,'separator',NULL,'Building that separates wastewater in the system but does not discharge it from the system. Exception: In front of a catch basin or catch channel, mixed wastewater is discharged into the watercourse via the separation structure after filling the basin volume. One or more inlets, two or more outlets.','Bauwerk, welches Abwasser im System auftrennt, aber nicht aus dem System entlastet. Ausnahme: Vor einem Fangbecken oder Fangkanal wird nach Füllung des Beckenvolumens Mischabwasser über das Trennbauwerk ins Gewässer entlastet. Ein oder mehrere Zuläufe, zwei oder mehr Abläufe.','Ouvrage, qui répartit les eaux dans le système sans les déverser. Exception: avant un bassin ou un canal de stockage, les eaux mixtes sont déversées dans le cours ou plan d''eau via l''ouvrage de répartition après remplissage du volume du bassin. Une ou plusieurs entrées, deux ou plusieurs sorties.','Manufatto che suddivide le acque reflue nel sistema ma senza scaricarle. Eccezione: prima di un bacino di accumulo in parallelo, dopo riempimento del volume del bacino, le acque miste vengono scaricate nel ricettore naturale attraverso la camera di ripartizione. Uno o più entrate, due o più scarichi.','rrr_structura speciala care repartizeaza apele in sistem fara a le deversa. Rrr_ Ausnahme: Vor einem Fangbecken oder Fangkanal wird nach Füllung des Beckenvolumens Mischabwasser über das Trennbauwerk ins Gewässer entlastet. Are una sau mai multe intrari, doua sau mai multe iesiri.');
