ist und von Bodenoberflächen oder von Gebäudeaussenflächen in das Entwässerungsystem eingeleitet ist (SIA 190.301 = EN 16323:2014). Die Zuordnung zu verschmutztem oder unverschmutztem Abwasser erfolgt nach der Gewässerschutzgesetzgebung bzw. nach Anleitung der VSA-Richtlinie "Abwasserentsorgung bei Regenwetter".');
